var start_date=new Date();var stop_date=new Date();var retrieve_start_date=function(){var a=$(this).attr("name");var c=$(this).attr("value");var b=a.substring(a.length-2,a.length-1);parse_type_to_date(b,start_date,c)};var set_stop_date=function(){var a=$(this).attr("name");var c=$(this).attr("value");var b=a.substring(a.length-2,a.length-1);parse_date_to_type(b,stop_date,$(this))};var parse_type_to_date=function(b,a,c){if(b=="d"){a.setDate(c);return}if(b=="F"){a.setMonth(c-1);return}if(b=="Y"){a.setFullYear(c);return}if(b=="H"){a.setHours(c);return}if(b=="i"){a.setMinutes(c);return}};var parse_date_to_type=function(c,b,a){if(c=="d"){a.attr("value",b.getDate());return}if(c=="F"){a.attr("value",b.getMonth()+1);return}if(c=="Y"){a.attr("value",b.getFullYear());return}if(c=="H"){a.attr("value",b.getHours());return}if(c=="i"){a.attr("value",b.getMinutes());return}};